window.bookSummaryJSON = "<p>People can be so resistant to your ideas. Wouldn’t you like to be able to slip into someone’s mind and make him or her do your bidding? Since the days of crazy CIA mind-control experiments, a series of highly secretive methods of subliminal mind control have been available. But they have been kept under wraps because of their power. Now you can find them out for yourself and make your life what you want it to be by gaining control over the minds of others.&nbsp;</p> <p>Subliminal psychology is a special and top-secret science that explores how to enter someone’s subconscious mind. There, you can plant ideas that the person will start acting on without knowing why. Using signals, gestures, images, scents, sounds, touch, and words, you can influence someone tremendously and very stealthily. No one will know why they do the things they do under your influence.</p> <p>Subliminal psychology has a huge variety of uses. In this book, you will learn how to use it for seduction and settling conflict in your personal relationships. You will also use it to beat the odds in competitions. You will learn how to use it to make work better for you, and to gain dominance over others. You will learn how to apply it to parenting and relationships of all kinds. Finally, you will learn how to utilize it on yourself to bring out your best, end bad habits, and build confidence and self-esteem through positive thinking.&nbsp;</p> <p>Hack your own mind. Or hack others'. The secrets to how are all here.</p>"; 
